Storyline:

   Set in 1912 Mexico, an Arizona lawman named Lyedecker (Brown) travels to a remote village looking for Yaqui Joe (Reynolds), a half-Indian, half-white bank robber who stole $6,000 (in Arizona) to buy 100 rifles for his  tribesmen, who are being repressed by the government. Lyedecker isn't concerned with Yaqui Joe's cause of helping his tribe, and all he cares about is getting the money returned to a Phoenix bank within his jurisdiction. The two men soon soon encounter Sarita (Welch), a beautiful Indian revolutionary. The three eventually become allies and join in the fight to end the oppression the Indians are suffering under.


